Micro-BenchMark from ResNet50 decomposition. 
1st branch path: input 14x14x1024 -> conv-f1s2p0k512 output 7x7x512 -> conv-f3s1p1k512 output 7x7x512 -> conv-f1s1p0k2048 output 7x7x2048 -> ew-sum; 
