"search_lstm.py":
inputs = tf.nn.bias_add(tf.matmul(array_ops.concat([[14, 200], [14, 128]], 1), [328, 512]) , [512]);
i, j, f, o = array_ops.split(value=inputs, num_or_size_splits=4, axis=1)  // split to [14, 128] x 4;
new_c = ([14, 128] * sigmoid(f + 0.5) + sigmoid(i) * tanh(j))  // [14, 128]
new_h = tanh(new_c) * sigmoid(o)  // [14, 128]
inputs2 = tf.nn.bias_add(tf.matmul(array_ops.concat([new_h, [14, 128]], 1), [256, 512]) , [512]);
i2, j2, f2, o2 = array_ops.split(value=inputs2, num_or_size_splits=4, axis=1)  // split to [14, 128] x 4;
new_c2 = ([14, 128] * sigmoid(f2 + 0.2) + sigmoid(i2) * tanh(j2)) // [14, 128]
new_h2 = tanh(new_c2) * sigmoid(o2)
add = new_h +  new_h2  // [14, 128]
new_tuple = (new_c, new_h, new_c2, new_h2, add)
repeat above twice

